query getServices($roomType: String, $priceVersion: String!, $catalogProfileType: CatalogProfileType, $cancelledSuborder: Boolean) {
  getServices(roomType: $roomType, priceVersion: $priceVersion, catalogProfileType: $catalogProfileType, cancelledSuborder: $cancelledSuborder) {
    categoryName
    categoryId
    subCategories {
      subCategoryId
      subCategoryName
      fieldProductCount {
        fieldName
        fieldValues
        isFilter
        __typename
      }
      __typename
    }
    __typename
  }
}
